import styled from "styled-components";

export const StyledItem = styled.li`
    list-style: none;
    display: block;
    height: 30px;
    border: 2px solid slateblue;
    margin: 10px;
    text-align: center;
    border-radius: 5px;
    padding: 7px 7px 0 7px;
    box-shadow: 0 0 10px rgba(0,0,0,0.5);


`
